    return (
        <>
            <button type='button' onClick={() => setLanguagesOpen(!languagesOpen)}>
                EN
                <svg width="10" height="10" viewBox="0 0 10 10" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="M8.69238 4.5L5.15685 8.03553L1.62131 4.5" stroke="white" stroke-width="2"/>
                </svg>
            </button>
        </>
    )
}

export default Languages
